import React, {Component} from 'react';

const Saludo = (props) =>{
  //puedo hacer un condicional ternario de las siguiente manera
  return (
    <div>
      {props.saluda ? <h1>Hola, tu eres genial</h1> : <p> Wops, no hay saludo para ti! </p>}
    </div>
  )
}
const App = () =>{
  return(
    <div>
      <Saludo saluda/>
    </div>
  )
}
export default App;
